          }
        ]
      },
      {
        test: /\.svg(\?v=\d+\.\d+\.\d+)?$/,
        use: [
          {
            loader: 'url-loader',
            options: {
              limit: 10000,
              mimetype: 'image/svg+xml',
              context: path.resolve(__dirname, "./src/"),
              name: '[path][name].[ext]'
            }
          }
        ]
      },
      {
        test: /\.(jpe?g|png|gif|ico)$/i,
        use: [
          {
            loader: 'file-loader',
            options: {
              context: path.resolve(__dirname, "./src/"),
              name: '[path][name].[ext]'
            }
          }
        ]
      },
      {
